# Registration user
@app.route('/api/v1/registration', methods=['POST'])
def registration():
    json_data = request.json
    
    if json_data.get("password") != json_data.get("confirmpassword"):
        response = {
            "status": "10002",
            "message": "Passwords do not match"
        }
        logger.info(f"Passwords do not match {json_data}")
        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}

    try:
        # Пытаемся вставить пользователя
        success = insert_user(json_data["username"], json_data["password"], "user")
        logger.info(f'Trying to create user: [{json_data["username"]}] with password: [{json_data["password"]}] /api/v1/registration')
        if success:
            response = {
                "status": "200",
                "message": f'user with username {json_data["username"]} created'
            }
            logger.info(f"User {json_data['username']} created")
        else:
            logger.info(f'Failed to create user: [{json_data["username"]}] with password: [{json_data["password"]}], user already exist /api/v1/registration')
            response = {
                "status": "10000",
                "message": f'user with username {json_data["username"]} already exists'
            }

        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}

    except sqlite3.Error as e:
        # Ошибка работы с базой данных
        logger.error(f'Problem with database: {e}')
        response = {
            "status": "10001",
            "message": f"Problem with database: {e}"
        }
        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}

    except Exception as e:
        # Любая непредвиденная ошибка
        logger.error(f'Unexpected error /api/v1/registration: {e} ')
        response = {
            "status": "500",
            "message": f"Unexpected error: {e}"
        }
        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'} 


# Login user
@app.route('/api/v1/auth', methods=['POST'])
def auth():
    
    if request.method == "GET":
        return render_template("index.html")

    json_data = request.json

    try:
        check_pwd = get_passwd(json_data["username"])

        if not check_pwd or json_data["password"] != check_pwd[0][2]:
            logger.info(f'Wrong username or password for user: {json_data["username"]} with password: {json_data["password"]} /api/v1/auth')
            response = {
                "status": "401",
                "message": "Wrong username or password"
            }
            return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}

        user_payload = {
            "user_id": check_pwd[0][0],
            "username": check_pwd[0][1]
        }
        token = generate_jwt_token(user_payload)
        logger.debug(f'Generated JWT token: {token} for user: {json_data["username"]}')

        response = {
            "status": "200",
            "message": "Successful login"
        }
        resp = make_response(jsonify(response))
        resp.headers['Content-Type'] = 'application/json; charset=utf-8'
        resp.set_cookie('auth_token', value=token)
        return resp

    except sqlite3.Error as e:
        logger.error(f'Database error: {e}')
        response = {
            "status": "10003",
            "message": f"Database error: {e}"
        }
        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}

    except Exception as e:
        logger.error(f'Unexpected error /api/v1/auth: {e}')
        response = {
            "status": "500",
            "message": f"Unexpected error: {e}"
        }
        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}    


# Create Objects
@app.route('/api/v1/createobject', methods=['POST'])
def createObject():
    try: 
        if request.headers.get('Cookie'):
            if verify_token(request.headers.get('Cookie')[11:])[0]:
                json_data = request.json
                user_id = verify_token(request.headers.get('Cookie')[11:])[1]
                try: 
                    logger.info(f'Trying to create entity: [name={json_data["name"]} description={json_data["description"]} image={json_data["image"]}] /api/v1/createobject')
                    insert_entity(user_id, json_data["name"], json_data["description"], json_data["image"])
                    response = {
                        "status" : "200",
                        "message" : 'Object created'
                    }
                    return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                except IOError as e:
                    logger.error(f'Failed to create object /api/v1/createobject: {e}')
                    response = {
                        "status" : "10004",
                        "message" : f'Failed to create object {e}'
                    }
                    return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
            else:
                response = {
                    "status" : "401",
                    "message" : f"{verify_token(request.headers.get('Cookie')[11:])[1]}"
                }
                logger.info(f"Token exception Message: {verify_token(request.headers.get('Cookie')[11:])[1]}")
                return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                
        else: 
            response = {
                    "status" : "401",
                    "message" : "Unauthorized"
                }
            logger.info(f"Unauthorized request on /api/v1/createobject")
            return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                    
    except IOError as e:
        return e 



# Get content for user
@app.route('/api/v1/getobject', methods=['GET'])
def getObject():
    
    obj_id = request.args.get("id")
    if not obj_id:
        return jsonify({"error": "Missing 'id' parameter"}), 400
    
    try:
        int(obj_id)
    except ValueError:
        return jsonify({"error": "Invalid 'id' format, must be integer"}), 400
    
    if set(request.args.keys()) != {"id"}:
        return jsonify({"error": "Only 'id' parameter is allowed"}), 400
    
    try: 
        if request.headers.get('Cookie'):
            if verify_token(request.headers.get('Cookie')[11:])[0]:
                user_id = verify_token(request.headers.get('Cookie')[11:])[1]
                if str(user_id) != str(obj_id):
                    block = """data:image/jpeg;base64,"""
                    logger.info(f'Content for id = {obj_id} doesn\'t belong to user with user_id = {user_id}')
                    response = {
                        "status" : "405",
                        "message" : f'Content for id = {obj_id} doesn\'t belong to user with user_id = {user_id}',
                        "image" : f"{str(block)}"
                    }
                    return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                else:
                    try: 
                        content = get_content(user_id)
                        logger.info(f"Get content for user_id: {user_id}")
                        logger.debug(f"Content for user_id: {content}")
                        response = {
                            "status" : "200",
                            "message" : f'{content}'
                        }
                        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                    except IOError as e:
                        logger.error(f'Failed to get object /api/v1/getobject?id={obj_id}: {e}')
                        response = {
                            "status" : "10005",
                            "message" : f'Failed to get object {e}'
                        }
                        return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
            else:
                response = {
                    "status" : "401",
                    "message" : f"{verify_token(request.headers.get('Cookie')[11:])[1]}"
                }
                return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                
        else: 
            response = {
                    "status" : "401",
                    "message" : "Unauthorized"
                }
            logger.info(f"Unauthorized request on /api/v1/getobject")
            return jsonify(response), {'Content-Type': 'application/json; charset=utf-8'}
                    
    except IOError as e:
        return e 

        
